  'Zafgen Inc.',
  'Zogenix Inc.',
  'ZIOPHARM Oncology Inc',
  'Zai Lab Limited',
  'Zosano Pharma Corporation',
  'Zymeworks Inc.',
  'Zynerba Pharmaceuticals Inc.'
