for (var i of comps) {
  var names = [
    i.replace(' (DE)', ''),
    i.replace(' (Delaware)', ''),
    i.replace(' Class A', ''),
    i.replace(' Inc.', ''),
    i.replace(' Inc', ''),
    i.replace(' Incorporated', ''),
    i.replace(' plc', ''),
    i.replace(' Limited', ''),
    i.replace(' Ltd.', ''),
    i.replace(' N.V.', ''),
    i.replace(' S.A.', ''),
    i.replace(' NV', ''),
    i.replace(' SA', ''),
    i.replace(' Corporation', ''),
    i.replace(' Corp.', ''),
    i.replace(' Corp', ''),
    i.replace(' A/S', ''),
    i.replace(' AG', ''),
    i.replace(' A/S', '')
  ]
  var res = []
  for (var k of names) {
    res.push(new RegExp(k, 'i'))
  }
  var q = {
    $or: [
			{'name': {$in: res}},
			{'synonyms.name': {$in: res}}
    ]
  }
  var mgs = db.medicalgroup.find(q).toArray()
// 	print(i)
  if (mgs.length == 0) {
    print(i)
    print('None')

    if (i.split('plc')[1] === '') {
      var rec = {
        'id': i,
        'alias': i,
        'analyzer': '',
        'code': '',
        'custom': true,
        'description': '',
        'exclude': false,
        'linkedSyns': [],
        'name': i,
        'parents': [],
        'rootSynonym': '',
        'synonyms': [
          {
            'name': i.replace(' plc', ''),
            'custom': true,
            'suppress': false,
            'analyzer': 'DEFAULT'
          }
        ]
      }
			// print(JSON.stringify(rec))
      db.medicalgroup.insert(rec)
      db.medicalgroupoverride.insert(rec)
    }
  }
}

